function createPlayers(){
    for(let i =0; i < playerCount; i++){
        let color;
        do{
           color = colors[Math.floor(Math.random() * colors.length)];
        }while(players.some(player => player.color === color))
        players.push(new player(i, color))
    }
    console.log("players are")
    console.log(players)
}

function assignRandomTiles(){
    let shuffledTiles = allTiles.sort(() => Math.random() - 0.5);
    let tilesPerPlayer = Math.floor(shuffledTiles.length / playerCount);
    let extraTiles = shuffledTiles.length % playerCount;
    for (let i = 0; i < playerCount; i++) {
        let playerTiles = shuffledTiles.slice(i * tilesPerPlayer, (i + 1) * tilesPerPlayer);
        if (i < extraTiles) {
            playerTiles.push(shuffledTiles[playerCount * tilesPerPlayer + i]);
        }
        players[i].tiles = playerTiles;
    }
}

function updateTilesState(){
    players.forEach(player => {
        player.tiles.forEach(tile => {
            // figuring out what classes the tiles have
            //console.log(`Tile ${tile.name} belongs to player ${player.num} and the class is ${tile.path.classList}`);
            tile.path.setAttribute("fill", player.color);
            if (tile.textCircle) {
                tile.textCircle.setAttribute("fill", player.color);
            }
        });
    }
    );
}

