function isBigger(text1, text2) {
    let b1 = text1.getBBox();
    let b2 = text2.getBBox();
    return (b1.width * b1.height) >= (b2.width * b2.height);
}

function resizeTexts(){
    let texts = document.querySelectorAll("svg text")
    //console.log(circles)
    let switched = false;
    texts.forEach((t) =>{
        //console.log(t.id)
        let bbox = t.getBBox()
        //console.log(bbox)
        //return
        texts.forEach((t2) =>{
            if(t.id != t2.id){
                let otherBbox = t2.getBBox()
                //console.log("at t2s box")
                //console.log(bbox.x)
                //return
                if(bbox.x < otherBbox.x + otherBbox.width &&
                    bbox.x + bbox.width > otherBbox.x &&
                    bbox.y < otherBbox.y + otherBbox.height &&
                    bbox.y + bbox.height > otherBbox.y){
                    //console.log("hereeee")
                    if (isBigger(t, t2)) {
                        //console.log("here")
                        while (bbox.x < otherBbox.x + otherBbox.width &&
                            bbox.x + bbox.width > otherBbox.x && // they have a similar x

                            bbox.y < otherBbox.y + otherBbox.height && // they have a similar y
                            bbox.y + bbox.height > otherBbox.y){
                            let fontSize = parseFloat(t.getAttribute("font-size"));
                            fontSize *= 0.9; // Decrease the font size by 10%
                            t.setAttribute("font-size", `${fontSize}px`);
                            bbox = t.getBBox(); // Update the bounding box after resizing
                            if (fontSize < 5) {
                                if (!switched) {
                                    console.warn(`Text ${t.id} is too small to resize further, will resize the other text.`);
                                    let t3 = t2
                                    t2 = t
                                    t = t3;
                                    bbox = t.getBBox(); // Update the bounding box after resizing
                                    otherBbox = t2.getBBox(); // Update the bounding box of the other text
                                    switched = true;
                                }else{
                                    break
                                }
                            }
                        }
                    }
                }
            }
        })
    })
}

function createCircleTexts(){
    allTiles.forEach(tile => {
        let path = tile.path;
        let s = document.querySelector("svg")
        let bbox = path.getBBox(); // this is the bounding box of the tile, it is used to find the center
        // making a circle under the text
        let circle = document.createElementNS("http://www.w3.org/2000/svg", "circle");
        circle.setAttribute("fill", "white");
        circle.setAttribute("stroke", "black");
        circle.setAttribute("stroke-width", "1");
        circle.setAttribute("id", `${path.id}-c`);
        let text = document.createElementNS("http://www.w3.org/2000/svg", "text");
        text.setAttribute("pointer-events", "none"); // this is to prevent the text from blocking the clicks on the tiles
        text.setAttribute("id", `${path.id}-text`);
        let size =window.innerWidth/80
        if (size > 10){
            size = 10
        }
        text.setAttribute("font-size", `${size}px`)
        text.textContent = `${path.id}(0)`
        text.setAttribute("fill", "black")
        text.setAttribute("x", bbox.x + bbox.width / 2);
        text.setAttribute("y", bbox.y + bbox.height / 2);
        text.setAttribute("text-anchor", "middle");
        s.appendChild(text);
        requestAnimationFrame(() => {
        //console.log("here")
        const bbox = text.getBBox();
        circle.setAttribute("r", `${Math.max(bbox.width, bbox.height)/2+1}`); // radius is half of the bigger dimension of the text bounding box plus 5px
        //circle.setAttribute("r", "5")
        circle.setAttribute("cx", bbox.x + bbox.width / 2);
        circle.setAttribute("cy", bbox.y + bbox.height / 2);
        });
        s.removeChild(text) // the text needs to be removed and readded so that its on top of the circle
        s.appendChild(circle);
        s.appendChild(text);
        circle.addEventListener("click", (event) => {
            event.stopPropagation();
            countryClick(path.id);
        });
        circle.addEventListener("mouseover", () => {
            displayFormablesText(path);
        });
        circle.addEventListener("mouseout", () => {
            resetFormablesText();
        });
        tile.textCircle = circle; // add the circle to the tile object
        tile.text = text; // add the text to the tile object
    })
}

function getTiles() {
    let tiles = document.querySelectorAll("svg path")
    let ans = [];
    for (let i = 0; i < tiles.length; i++) {
        if (tiles[i].id !== "" && !tiles[i].id.includes("UI")) {
            ans.push(tiles[i]);
        }
    }
    return ans;
}

function showAttackOptions(id){
    //console.log("showing attack options for " + id);
    // this function will show the attack options for the current player
    // it will highlight the neighboring tiles of the clicked tile
    let tile = allTiles.find(t => t.name === id);
    //console.log("tile is", tile);
    if (tile) {
        tile.neighbors.forEach(neighborId => {
            let neighborTile = allTiles.find(t => t.name === neighborId);
            if (neighborTile) {
                neighborTile.path.classList.add('attackable');
            }
        });
    }
}

function countryClick(id){
    allTiles.forEach((tile)=>{
        tile.path.classList.remove('highlighted', 'dimmed', 'attackable');
        if(tile.name != id){
            tile.path.classList.add("dimmed")
        }else{
            tile.path.classList.add("highlighted")
        }
    })
    // pokud atualni player je na rade tak ukazat attack options
    if(globalPlayer == thisPlayer && players[thisPlayer-1].tiles.some(tile => tile.name === id)){ // checking if its the players turn and if he controls the tile
        showAttackOptions(id)
    }
    
}

function getFormable(id){
    for (let i = 0; i < allForm.length; i++) {
        let formable = allForm[i];
        if (formable.includes(id)) {
            return formable;
        }
    }
    return null; // if no formable is found
}

